DELIMITER //
CREATE TRIGGER `after_track_comments_delete` AFTER DELETE ON `track_comments`
 FOR EACH ROW BEGIN
 
    UPDATE tracks
    SET comments = comments - 1
    WHERE tracks.id = OLD.trackId;
END
