DELIMITER ;
DROP TRIGGER IF EXISTS `after_track_comments_insert`;
DELIMITER //
CREATE TRIGGER `after_track_comments_insert` AFTER INSERT ON `track_comments`
 FOR EACH ROW BEGIN
 
    UPDATE tracks
    SET comments = comments + 1
    WHERE tracks.id = NEW.trackId;
END
//
DELIMITER ;

